import React from 'react'
import Banner from '../Components/Banner/Banner';
const CoinTable = React.lazy(()=> import('../Components/CoinTable'))

const HomePage = () => {
  return (
    <div>
    <Banner/>
    <Suspense fallback={<div>Loading...</div>}>
      
    </Suspense>
    <CoinTable/>
    </div>
  )
}

export default HomePage
